import{_ as t,c as a,an as r,o}from"./chunks/framework.CkyLdKpM.js";const p=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"好文阅读历史/202304.md","filePath":"好文阅读历史/202304.md","lastUpdated":1684583040000}'),i={name:"好文阅读历史/202304.md"};function l(h,e,s,c,n,b){return o(),a("div",null,e[0]||(e[0]=[r('<h2 id="好文" tabindex="-1">好文 <a class="header-anchor" href="#好文" aria-label="Permalink to &quot;好文&quot;">​</a></h2><h3 id="_1-rrweb-实现原理介绍" tabindex="-1">1.rrweb 实现原理介绍 <a class="header-anchor" href="#_1-rrweb-实现原理介绍" aria-label="Permalink to &quot;1.rrweb 实现原理介绍&quot;">​</a></h3><p>作者：郝润雨 字节前端 ByteFE</p><p>摘要：rrweb 全称 &#39;record and replay the web&#39;，是当下很流行的一个录制屏幕的开源库。与我们传统认知的录屏方式（如 WebRTC）不同的是，rrweb 录制的不是真正的视频流，而是一个记录页面 DOM 变化的 JSON 数组，因此不能录制整个显示器的屏幕，只能录制浏览器的一个页签。</p><p>Demo 地址：<a href="https://www.rrweb.io/demo/checkout-form" target="_blank" rel="noreferrer">https://www.rrweb.io/demo/checkout-form</a></p><p>原文地址：<a href="https://mp.weixin.qq.com/s/5RUjvKOBjqX5Btrse-C3Jg" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/s/5RUjvKOBjqX5Btrse-C3Jg</a></p><h3 id="_2" tabindex="-1">2. <a class="header-anchor" href="#_2" aria-label="Permalink to &quot;2.&quot;">​</a></h3><h2 id="开源框架、工具、仓库" tabindex="-1">开源框架、工具、仓库 <a class="header-anchor" href="#开源框架、工具、仓库" aria-label="Permalink to &quot;开源框架、工具、仓库&quot;">​</a></h2><h3 id="_1-clarity" tabindex="-1">1.clarity <a class="header-anchor" href="#_1-clarity" aria-label="Permalink to &quot;1.clarity&quot;">​</a></h3><p>微软开源的 web 用户行为分析工具，它可以帮助您了解用户如何在所有现代设备和浏览器上查看和使用您的网站。 还可以对用户的操作进行录制和回放。</p><p>地址：github.com/microsoft/clarity</p><p>在线 demo：clarity.microsoft.com/demo ​​​</p><h3 id="_2-蚂蚁数据体验技术团队的文章仓库" tabindex="-1">2. 蚂蚁数据体验技术团队的文章仓库 <a class="header-anchor" href="#_2-蚂蚁数据体验技术团队的文章仓库" aria-label="Permalink to &quot;2. 蚂蚁数据体验技术团队的文章仓库&quot;">​</a></h3><p>虽然上次更新已经是 3、4 年前了。有很多高质量的文。</p><p>地址：<a href="https://github.com/ProtoTeam/blog" target="_blank" rel="noreferrer">https://github.com/ProtoTeam/blog</a></p><h3 id="_3-airsim" tabindex="-1">3.AirSim <a class="header-anchor" href="#_3-airsim" aria-label="Permalink to &quot;3.AirSim&quot;">​</a></h3><p>基于虚幻引擎构建的无人机、汽车模拟器。这是一款微软开源的无人机和汽车的仿真模拟器，支持使用流行的飞行控制器进行软件在环(SIL)仿真，并使用 PX4 进行硬件在环(HIL)模拟，实现物理和视觉上逼真的模拟，可用于试验自动驾驶汽车、计算机视觉和强化学习算法。</p><p><img src="https://github.com/microsoft/AirSim/blob/main/docs/images/AirSimDroneManual.gif?raw=true" alt="Alt text"><img src="https://github.com/microsoft/AirSim/blob/main/docs/images/AirSimCarManual.gif?raw=true" alt="Alt text"></p><p>仓库地址：<a href="https://github.com/microsoft/AirSim" target="_blank" rel="noreferrer">https://github.com/microsoft/AirSim</a></p><h3 id="_4-kwok" tabindex="-1">4.kwok <a class="header-anchor" href="#_4-kwok" aria-label="Permalink to &quot;4.kwok&quot;">​</a></h3><p>go 项目。模拟 K8s 集群的工具。它可以在几秒钟内搭建一个由数千个节点组成的 Kubernetes 集群，整个过程仅占用非常少的资源，轻松实现在本机上学习、测试和开发 K8s 集群应用。</p><p><img src="https://github.com/kubernetes-sigs/kwok/blob/main/demo/manage-clusters.svg?raw=true" alt="Alt text"></p><p>仓库地址：<a href="https://github.com/kubernetes-sigs/kwok" target="_blank" rel="noreferrer">https://github.com/kubernetes-sigs/kwok</a></p><h3 id="_5-mathquill" tabindex="-1">5.mathquill <a class="header-anchor" href="#_5-mathquill" aria-label="Permalink to &quot;5.mathquill&quot;">​</a></h3><p>数学公式在线编辑器。这是一个 JavaScript 写的公式编辑器，它可以让数学公式输入变得简单和美观。</p><p><img src="https://cloud.githubusercontent.com/assets/225809/15163580/1bc048c4-16be-11e6-98a6-de467d00cff1.gif" alt="Alt text"></p><p>地址：<a href="https://github.com/mathquill/mathquill" target="_blank" rel="noreferrer">https://github.com/mathquill/mathquill</a></p><h3 id="_6-kibi" tabindex="-1">6.kibi <a class="header-anchor" href="#_6-kibi" aria-label="Permalink to &quot;6.kibi&quot;">​</a></h3><p>不到 1024 行的文本编辑器。这是一个用不到 1024 行 Rust 代码编写的命令行文本编辑器，支持 UTF-8、语法高亮、行号等基础功能。</p><p><img src="https://raw.githubusercontent.com/ilai-deutel/kibi/master/assets/asciicast.gif" alt="Alt text"></p><p>地址：<a href="https://github.com/ilai-deutel/kibi" target="_blank" rel="noreferrer">https://github.com/ilai-deutel/kibi</a></p><h3 id="_7-veloren" tabindex="-1">7.veloren <a class="header-anchor" href="#_7-veloren" aria-label="Permalink to &quot;7.veloren&quot;">​</a></h3><p>一款 Rust 写的像素风 RPG 游戏。它的灵感来自《塞尔达传说：旷野之息》、《矮人要塞》和《我的世界》等游戏。虽然这款游戏的画质低，但拥有广阔的开放世界，玩家在游戏里可以打造道具、合成物品、战斗、升级、驯养宠物，还可以探索地牢洞穴、在空中滑翔、与 NPC 交易。</p><p><img src="https://camo.githubusercontent.com/410b8310c66bdd9fc9dca1b94884fe6fd721840d19e31b23b323d3ac4b00b2d0/68747470733a2f2f63646e2e646973636f72646170702e636f6d2f6174746163686d656e74732f3534313330373730383134363538313531392f3731323239353630353137303630323037352f6c6f676f2e706e67" alt="Alt text"></p><p>地址：<a href="https://github.com/veloren/veloren" target="_blank" rel="noreferrer">https://github.com/veloren/veloren</a></p><h3 id="_8-dockerlabs" tabindex="-1">8.dockerlabs <a class="header-anchor" href="#_8-dockerlabs" aria-label="Permalink to &quot;8.dockerlabs&quot;">​</a></h3><p>适合所有阶段开发者的 Docker 教程。该教程的内容分为初、中、高三个级别，适合所有阶段的 Docker。内含 500 个动手实验，以及 Docker 和 Docker Compose 小抄，这一切全部开源且分文不取。</p><p>地址：<a href="https://github.com/collabnix/dockerlabs" target="_blank" rel="noreferrer">https://github.com/collabnix/dockerlabs</a></p><h3 id="_9-flutter-twitter-clone" tabindex="-1">9.flutter_twitter_clone <a class="header-anchor" href="#_9-flutter-twitter-clone" aria-label="Permalink to &quot;9.flutter_twitter_clone&quot;">​</a></h3><p>Flutter 写的推特客户端。这是一款用 Flutter 写的第三方 Twitter 客户端，实现了登录/注册、信息流、回复、通知、个人主页等功能。</p><p>地址：<a href="https://github.com/TheAlphamerc/flutter_twitter_clone" target="_blank" rel="noreferrer">https://github.com/TheAlphamerc/flutter_twitter_clone</a></p><h3 id="_10-my-re0-k8s-security" tabindex="-1">10.my-re0-k8s-security <a class="header-anchor" href="#_10-my-re0-k8s-security" aria-label="Permalink to &quot;10.my-re0-k8s-security&quot;">​</a></h3><p>从零开始的 Kubernetes 攻防。该项目包含了作者在多处攻防场景，所遇到的云原生相关的漏洞挖掘和漏洞利用实例。</p><p><img src="https://camo.githubusercontent." alt="Alt text"></p><p>地址：<a href="https://github.com/neargle/my-re0-k8s-security" target="_blank" rel="noreferrer">https://github.com/neargle/my-re0-k8s-security</a></p><h3 id="_11-segment-anything" tabindex="-1">11.segment-anything <a class="header-anchor" href="#_11-segment-anything" aria-label="Permalink to &quot;11.segment-anything&quot;">​</a></h3><p>分割一切的图像分割模型。它是来自 Meta AI 研究院的图像分割模型，只需一键就可以“切出”图像中的任何对象。它在 1100 万张图像和 11 亿个掩码(mask) 的数据集上完成了训练，能够在各种分割任务上具有很强的零样本(zero-shot) 性能。</p><p>地址：<a href="https://github.com/facebookresearch/segment-anything" target="_blank" rel="noreferrer">https://github.com/facebookresearch/segment-anything</a></p><h3 id="_12-rust-语言圣经" tabindex="-1">12.rust 语言圣经 <a class="header-anchor" href="#_12-rust-语言圣经" aria-label="Permalink to &quot;12.rust 语言圣经&quot;">​</a></h3><p>地址：<a href="https://course.rs/about-book.html" target="_blank" rel="noreferrer">https://course.rs/about-book.html</a></p><h2 id="video" tabindex="-1">video <a class="header-anchor" href="#video" aria-label="Permalink to &quot;video&quot;">​</a></h2><h3 id="_1-【官方双语】有了它-人人都能当黑客-flipper-zero-评测-linus-谈科技" tabindex="-1">1.【官方双语】有了它 人人都能当黑客 - Flipper Zero 评测#linus 谈科技 <a class="header-anchor" href="#_1-【官方双语】有了它-人人都能当黑客-flipper-zero-评测-linus-谈科技" aria-label="Permalink to &quot;1.【官方双语】有了它 人人都能当黑客 - Flipper Zero 评测#linus 谈科技&quot;">​</a></h3><p>官网原价卖 169 刀，到国内都 3000 人民币了卧槽。。。 建议自己学硬件自己做</p><p>b 站地址：<a href="https://www.bilibili.com/video/BV1gm4y1m7Q2/?spm_id_from=333.999.0.0&amp;vd_source=b6cb3df5439265450701a4bbfead47ea" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1gm4y1m7Q2/?spm_id_from=333.999.0.0&amp;vd_source=b6cb3df5439265450701a4bbfead47ea</a></p>',54)]))}const u=t(i,[["render",l]]);export{p as __pageData,u as default};
